'From Squeak3.10beta of 22 July 2007 [latest update: #7137] on 19 November 2007 at 11:58:01 pm'!"Change Set:		CharacterSetComplement-M6367-nice-printingDate:			19 November 2007Author:			niceCharacterSetComplement cannot be printed, because they refuse to #do:This ChangesSet patches this behaviour"!!CharacterSetComplement methodsFor: 'printing' stamp: 'nice 11/19/2007 23:54'!printOn: aStream	"Print a description of the complement rather than self.	Rationale: self would be too long to print."		aStream nextPut: $(.	absent printOn: aStream.	aStream nextPut: $); space; nextPutAll: #complement.! !!CharacterSetComplement methodsFor: 'printing' stamp: 'nice 11/19/2007 23:55'!storeOn: aStream	"Store a description of the elements of the complement rather than self."		aStream nextPut: $(.	absent storeOn: aStream.	aStream nextPut: $); space; nextPutAll: #complement.! !!CharacterSetComplement reorganize!('comparing' = hash)('collection ops' add: do: includes: reject: remove: select: size)('private' byteArrayMap)('converting' complement)('initialize-release' complement:)('testing' hasWideCharacters)('printing' printOn: storeOn:)!